【H-505】PIAA ピア LEDバルブ<br>LED RING BULB FOR BMW専用 LEDリングバルブ<br>BMW　For 3 series　Coupe（3シリーズ　クーペ）　12V　2個入り<br><br>
新開発ワーニングキャンセラーにより、エンジン始動時のフラッシング現象を解消。<br>
透明感の高いホワイトを実現。<br>
車両側を無加工で取り付け可能。<br>
BMW車だけの美しい特殊導光リングに対応。光源の照射精度精密に再現し、<br>
最良の導光と透明感の高いホワイト光を実現。<br><br>
適用車種<br>
BMW 3series E92 <br>
  5series E60後期 <br>
    E61後期 <br>
  X5 E70 <br>
  X6 E71 <br>
<br><br>
※写真はイメージです。<br>
※適用につきましては、2012.2現在の情報です。年式、型式、グレードが同一でも正規輸入、並行輸入の
　違い等により、仕様が異なる場合があります。必ず現車にてご確認ください。<br>
※リング非装着車には、お取付出来ません。<br>
※適用車両以外のお車へはお取付出来ません。<br>
　また、適用車両以外のお車に取り付けの際、生じるトラブルに関しましては一切保証致しかねます。<br>
